import React from "react";
import "./css/school.css";

const SchoolArchive = (props) => {
    return (

        <div className="webgl-school">
            <h3>WebGL School Archive</h3>
            <ul className="archive">
                <li className="archive__item">
                    <a href="https://sana37na.github.io/webgl/work_210605/" target="_blank">
                        <img src="./img/20210605__1.png" alt="扇風機"></img>
                        <p>2021.06.05 - 課題：首振り機能付き扇風機</p>
                    </a>
                </li>
                <li className="archive__item">
                    <a href="https://sana37na.github.io/webgl/work_210605/2.html" target="_blank">
                        <img src="./img/20210605__2.png" alt="扇風機"></img>
                        <p>2021.06.05 - 課題：3D時計</p>
                    </a>
                </li>
            </ul>
        </div>
    )
};

export default SchoolArchive;
